import React from "react";

const Row = ({ recipe, handleDelete }) => {
  return (
    <React.Fragment>
      {recipes.map((recipe, index) => (
        <tr>
          <td>{recipe.name}</td>
          <td>{recipe.cuisine}</td>
          <td>
            <img src={recipe.photo} alt="food" />
          </td>
          <td className="content_td">
            <p>{recipe.ingredients}</p>
          </td>
          <td className="content_td">
            <p>{recipe.preparation}</p>
          </td>
        </tr>
      ))}
    </React.Fragment>
  );
};

export default Row;
